import React from 'react';

function App(){
  let quote="Life is not 10% always fair and just";
  let author="Murial Anindo"
  return(
    <div className="App">
      <header className="App-header">
        <p>
          {quote}
        </p>
        <p> -{author}

        </p>
      </header>
    </div>
  );
}

export default App;
